import { useCallback } from 'react';

const useArray = ({ obj }) => {
  const _temp = useCallback(function() {
    let _arr = [];
    let _temp = Object.entries(obj);
    if (!_temp) return [];
    _temp.forEach((data) => {
      _arr.push(data[1]);
    });
    return _arr;
  }, []);
  return _temp;
}

export default useArray;
